import React from "react";
import "./navbar.css";
import logo from "../../assets/catcomputer.jpg";
import { Link } from "react-scroll";

const Navbar = () => {
  return (
    <nav className="navbar">

      <div className="desktopMenu">
        <Link className="desktopMenuLinkItem">Home</Link>
        <Link className="desktopMenuLinkItem">Clients</Link>
        <Link className="desktopMenuLinkItem">Abbout</Link>
        <Link className="desktopMenuLinkItem">Portfolio</Link>
        <button className="desktopMenuBtn">
          <img src="" alt="" className="desktopMenuImg" />
          Contact Me
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
